DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `isEligible`(in studentId int,in criteria decimal(10,2),out isEligible int)
BEGIN
	declare marksFE,marksSE,marksTE,sumOfMarks,average decimal(10,2);
SELECT 
    FE, SE, TE
INTO marksFE , marksSE , marksTE FROM
    student
WHERE
    stu_id = studentId;
    set sumOfMarks=marksFE+marksSE+marksTE;
    set average=sumOfMarks/3;
    set isEligible=average>=criteria;
END ;;
DELIMITER ;
